import NavBar from "../components/NavBar";
//BOOTSTRAP
import { Container, Row, Col, Button } from "react-bootstrap";

const SpaceCraft = () => {
  return (
    <Container fluid>
      <NavBar />
      <Row xs={6}>
        <Col xs="3">
          <Button variant="outline-light">Light</Button>
        </Col>
      </Row>
      <h1>SpaceCraft</h1>
    </Container>
  );
};
export default SpaceCraft;
